using AdventOfCode.Year2023;

namespace AdventOfCodeTests.Year2023
{
    public class Day12Tests
    {
        [Test]
        public void DamagedSpringReport_CanReadInput()
        {
            var damagedSpringReport = new DamagedSpringReport(exampleInput1);

            damagedSpringReport.Rows[0].Arrangement.Should().Be("???.###");
            damagedSpringReport.Rows[0].DamagedList.Should().BeEquivalentTo([1, 1, 3]);
        }

        [Test]
        public void DamagedSpringReport_CanSolveDamagedRows()
        {
            var damagedSpringReport = new DamagedSpringReport(exampleInput1);

            damagedSpringReport.Rows[0].Possibilties.Should().Be(1);
            damagedSpringReport.Rows[1].Possibilties.Should().Be(4);
            damagedSpringReport.Rows[2].Possibilties.Should().Be(1);
            damagedSpringReport.Rows[3].Possibilties.Should().Be(1);
            damagedSpringReport.Rows[4].Possibilties.Should().Be(4);
            damagedSpringReport.Rows[5].Possibilties.Should().Be(10);
        }

        [Test]
        public void DamagedSpringReport_CanSolveExample1()
        {
            var damagedSpringReport = new DamagedSpringReport(exampleInput1);

            damagedSpringReport.SumDamagedRowPossibilties().Should().Be(21);
        }

